script: |
  super -f text -I q6469.spq | sort > q6469.out

inputs:
  - name: q6469.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT col0 IN ( - col1 * col0 + col2 + - col2 * col2 / tab1.col1 );
  - name: tab1

outputs:
  - name: q6469.out
    data: |
      3	26	54
      64	10	57
      80	13	96
